webpackJsonp([0xc32e0a26ce27],{712:function(a,e){a.exports={data:{markdownRemark:{html:'<p>Find any activity you’ve ever done on Strava using keywords, location, date, and a host of other filters.</p>\n<ul>\n<li>Text Search can use either keywords or precision text and results can be sorted on key metrics.</li>\n<li>Location Search lets you drop a pin on a map and return Activities within a specified Max Distance (default is 50 miles), sorted by their proximity to your pin.</li>\n</ul>\n<hr>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Activity Search"\n        title=""\n        src="/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-31818.png"\n        srcset="/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-b3e18.png 103w,\n/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-571c4.png 206w,\n/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-31818.png 412w,\n/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-1be92.png 618w,\n/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-05b5b.png 824w,\n/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-17809.png 1236w,\n/blog/static/activity-search-01-fe3fb3f22d6ef69130628264fcd185e2-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<h3>What does this do?</h3>\n<p>If you have ever tried to find an activity in Strava, you have probably noticed that you may not get all of the results you expect. This search aims to solve that and deliver insights you probably didn’t even know you wanted.</p>\n<p>By default, the page will show your activities in chronological order and you can simply keep pressing search to load more activities.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 17.337031900138697%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Search Results"\n        title=""\n        src="/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-31818.png"\n        srcset="/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-b3e18.png 103w,\n/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-571c4.png 206w,\n/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-31818.png 412w,\n/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-1be92.png 618w,\n/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-05b5b.png 824w,\n/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-17809.png 1236w,\n/blog/static/activity-search-03-95a169ded8a3ac3ef1580267b434b982-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  \n\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 22.746185852981966%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Search Results"\n        title=""\n        src="/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-31818.png"\n        srcset="/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-b3e18.png 103w,\n/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-571c4.png 206w,\n/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-31818.png 412w,\n/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-1be92.png 618w,\n/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-05b5b.png 824w,\n/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-17809.png 1236w,\n/blog/static/activity-search-02-eb6b75f8e53a1e4c348499038afc0480-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Results are displayed in three ways.</p>\n<ul>\n<li>The status bar above the Search button will show the number of activities that are loaded on the page, the number that match the search, and the overall total.</li>\n<li>The map will show pins for all of the loaded outdoor rides.</li>\n<li>The list below will show the loaded rides with their stats.</li>\n</ul>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 79.19556171983356%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Text Search"\n        title=""\n        src="/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-31818.png"\n        srcset="/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-b3e18.png 103w,\n/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-571c4.png 206w,\n/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-31818.png 412w,\n/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-1be92.png 618w,\n/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-05b5b.png 824w,\n/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-17809.png 1236w,\n/blog/static/activity-search-04-c3b2e4f13ca9232a3f0eb68e69fea10a-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Text Search</h4>\n<p>Just typing in the search box for a word or words you think you named an activity will probably work. This search uses real words, so “bike” also matches common pluralization like “bikes”. However, if you want more precision, try clicking the Precision box.\nText Search also allows you to return your activities sorted by all kinds of metrics. Search defaults to Descending Date, but if you want to sort by biggest Suffer Score, just use the Sort drop down.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 79.19556171983356%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Location Search"\n        title=""\n        src="/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-31818.png"\n        srcset="/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-b3e18.png 103w,\n/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-571c4.png 206w,\n/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-31818.png 412w,\n/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-1be92.png 618w,\n/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-05b5b.png 824w,\n/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-17809.png 1236w,\n/blog/static/activity-search-05-1e57b6ea14765682dd814ae4e8cef7c9-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Location Search</h4>\n<p>Ever want to find all the rides you did while on vacation or while visiting the in-laws? Switch over to Location Search by clicking the LOCATION SEARCH tab on the top right. Click anywhere on the map to drop a pin and search from there. Press the location button just above the map to show your current location.\nBy default it will search a 80 km/50 mi radius, <see this on how to switch your measurement preference> but you can change this by typing in a new Max Distance. Click Search and pins will be dropped indicating the loaded results on the page. Location results are limited to the first one hundred entries.</p>\n<p>Note: A Race athlete does not store your current location; this information is only used locally on your device. If you choose not to enable browser location, we will use the City from your Strava profile as your location.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 229.88505747126436%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Location Search"\n        title=""\n        src="/blog/static/activity-search-07-9ec3b07305420c996fd881543ca746d4-31818.png"\n        srcset="/blog/static/activity-search-07-9ec3b07305420c996fd881543ca746d4-b3e18.png 103w,\n/blog/static/activity-search-07-9ec3b07305420c996fd881543ca746d4-571c4.png 206w,\n/blog/static/activity-search-07-9ec3b07305420c996fd881543ca746d4-31818.png 412w,\n/blog/static/activity-search-07-9ec3b07305420c996fd881543ca746d4-1be92.png 618w,\n/blog/static/activity-search-07-9ec3b07305420c996fd881543ca746d4-05b5b.png 824w,\n/blog/static/activity-search-07-9ec3b07305420c996fd881543ca746d4-1ab41.png 1044w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Filters</h4>\n<p>Filters work for both Text and Location searches.\nClick the “filters” toggle to open the filter panel on the right.\nAt the top you can make commutes and trainer rides Exclusive or Excluded. Default is inclusive.</p>\n<p>Below the check boxes are the range filters. Range filters will only include results within the range you specify. You can specify dates, distance, elevation, and a host of other ranges. If you want to know all the rides between certain dates, for instance while you were riding the Tour de France last year, just set the date ranges for those dates and search will return those three weeks. Perhaps you want to know all of the rides you’ve done longer than 100 miles? Move the left distance slider to 100 and search and it will return all rides over 100 miles.</p>\n<p>Note: Trainer rides - Currently Zwift and other Virtual Ride software do not match Trainer because Strava has reclassified them as Virtual Rides and doesn’t turn on the trainer option for the activity. Look for an update to fix this in A Race athlete in the near future.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75.72815533980582%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Search Results"\n        title=""\n        src="/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-31818.png"\n        srcset="/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-b3e18.png 103w,\n/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-571c4.png 206w,\n/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-31818.png 412w,\n/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-1be92.png 618w,\n/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-05b5b.png 824w,\n/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-17809.png 1236w,\n/blog/static/activity-search-06-9919db53521d0a1aa0f1f09b76f7cc90-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<h4>Activity Stats</h4>\n<p>Each Activity will be displayed with metrics and link to original Strava activity. To switch your measurement preferences in real time, use the <a href="/blog/toggle-m-pref">Measurement Preference Toggle</a>.</p>\n<h4>Download</h4>\n<p>The Download button lets you download all of the results for that search as a CSV (they do not have to be loaded on the page). If you use the download button for the initial search, it will download all of your activities.</p>',frontmatter:{title:"Activity Search",date:"2018-02-15T00:20:00.000Z",path:"/activity-search/",parent:"/home/hypersprite/Documents/code/araceathlete-gatsby-material-ui-v1/src/pages/blog-posts/activity-search.md absPath of file",tags:"activities,newbie,results",description:"Activity Search will help you find your Strava activities",cover:{childImageSharp:{responsiveSizes:{src:"/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-7b166.png",sizes:"(max-width: 412px) 100vw, 412px",srcSet:"/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-32196.png 103w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-e3336.png 206w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-7b166.png 412w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-01e4b.png 618w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-0751a.png 824w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-832e5.png 1236w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-d700e.png 1442w",originalImg:"/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-d700e.png",originalName:"activity-search-cover.png",aspectRatio:1.5606060606060606,base64:"data:image/png;base64,"}}}}}},pathContext:{slug:"/blog-posts/activity-search/"}}}});
